- input: "TEXT\x1CC00277541\x1CX0\x1C\x1CF3XN\x1CThe Fairfax County Democratic Committee
    is filing monthly in 2008 because it expects gross receipts over $100,000 and
    because it will be engaged in federal election activity this year.     The committee
    pays no full time employees, and it has no part time employees or disbursements
    for employee compensation. The Committee is staffed entirely with volunteers.
    The Committee maintains separate bank accounts for its non-federal and its federal
    election receipts and expenditures. Even though expenses are allocable under Federal
    regulations and transfers of non federal funds are permissible to the Federal
    account, The Committee does not allocate funds between accounts, so all  fund
    raising expenses and all administrative expenses of the Committee are financed
    with Federal funds.  "
